class AriesAdapter {
  async read() {
    let str = window.localStorage.getItem('aries-web-wallet');
    return JSON.parse(str);
  }

  async write(obj) {
    window.localStorage.setItem('aries-web-wallet', JSON.stringify(obj));
  }
}

